function ispisiSveKorisnike(){$.ajax({url:"../../modules/korisnici/sviKorisnici.php",dataType:"json",method:"post",success:function(i){$(".obrisi").click(obrisiKorisnika),$(".podaciJedanKorisnik").click(ispisiJednogKorisnika),$("#sakri").click(function(){$("#podaci").slideUp("slow")})},error:function(i,e,s){alert(i.status+e)}})}function obrisiKorisnika(i){i.preventDefault();let e=confirm("Da li ste sigurni da zelite da obrisete korisnika?"),s=$(this).data("id");e&&$.ajax({url:"../../modules/korisnici/deleteUser.php",method:"post",dataType:"json",data:{id:s},success:function(i){ispisiSveKorisnike()},error:function(i,e,s){409==i.status?$(".odgovorUpdate").html("Ne mo≈æete obrisati korisnika"):alert(i.status+e)}})}function ispisiJednogKorisnika(i){i.preventDefault(),$("#podaci").slideDown("slow");var e=$(this).data("id");$.ajax({url:"../../modules/korisnici/jedanKorisnik.php",method:"POST",dataType:"json",data:{id:e},success:function(i){$("#tbIme").val(i.ime),$("#tbPrezime").val(i.prezime),$("#tbEmail").val(i.email),$("#ddlUloga").val(i.idUloga),$("#skrivenoPolje").val(i.idKorisnik)},error:function(i,e,s){switch(i.status){case 404:alert("Stranica nije pronadjena");break;case 500:alert("Greska na serveru.Trenutno nije moguce azurirati podatke o korisniku");break;default:alert("Greska:"+i.status+"-"+e)}}})}$(document).ready(function(){ispisiSveKorisnike()});